import{b as r}from"./app.9da19d67.js";import{_ as t}from"./plugin-vue_export-helper.21dcd24c.js";const i={},a=r(`<p>cookie&amp;session-connect</p><h2 id="\u4E00\u3001\u524D\u8A00" tabindex="-1"><a class="header-anchor" href="#\u4E00\u3001\u524D\u8A00" aria-hidden="true">#</a> \u4E00\u3001\u524D\u8A00</h2><p>\u201C\u4E0D\u597D\u4E86\uFF0C\u7EBF\u4E0A\u670D\u52A1\u5668\u8D85\u65F6\u4E25\u91CD\uFF0C\u8BF7\u6C42\u975E\u5E38\u6162\uFF0C\u597D\u50CF\u62A5\u8FDE\u63A5\u6570<code>too many</code>\u4E86\uFF0C\u600E\u4E48\u529E\uFF1F\u201C\u5C0F\u4F19\u4F34\u4EEC\u5728\u53CD\u9988\u3002\u4E00\u822C\u6211\u4EEC\u7684\u6280\u672F\u8001\u5927\u7684\u5904\u7406\u65B9\u5F0F\uFF0C\u628A\u8FDE\u63A5\u6570\u548C\u7EBF\u7A0B\u6C60\u8C03\u5927\u70B9\uFF0C\u91CD\u542F\uFF0C\u518D\u89C2\u5BDF\u3002</p><p>\u5F80\u5F80\u8FD9\u4E2A\u65B9\u5F0F\u662F\u5E94\u6025\u63AA\u65BD\uFF0C<strong>\u6CBB\u6807\u4E0D\u6CBB\u672C\uFF0C\u56E0\u4E3A\u4E0D\u77E5\u9053\u95EE\u9898\u7684\u539F\u56E0</strong>\u3002</p><p>\u6709\u4E2A\u4E25\u91CD\u8BEF\u533A\uFF0C\u4EE5\u4E3A<strong>\u7EBF\u7A0B\u6C60\u8BBE\u7F6E\u592A\u5C0F\u4E86\uFF0C\u8C03\u5927\u70B9\u8BF7\u6C42\u5C31\u4F1A\u5FEB\u4E86\u3002</strong></p><p>\u4ECA\u5929\u5C31\u5E26\u7740\u5C0F\u4F19\u4F34\u4EEC\u6C9F\u901A\u4E00\u4E0B\uFF0C\u7EBF\u7A0B\u6C60\u7684\u5927\u5C0F\u5E94\u8BE5\u5982\u4F55\u5408\u7406\u7684\u8BBE\u7F6E\u5176\u5927\u5C0F\uFF1F</p><h2 id="\u4E8C\u3001\u95EE\u9898" tabindex="-1"><a class="header-anchor" href="#\u4E8C\u3001\u95EE\u9898" aria-hidden="true">#</a> \u4E8C\u3001\u95EE\u9898</h2><p>\u5982\u679C\u6709\u4E24\u4E2A\u4EFB\u52A1\u9700\u8981\u5904\u7406\uFF0C\u4E00\u4E2A\u4EFB\u52A1A\uFF0C\u4E00\u4E2A\u4EFB\u52A1B</p><ul><li>\u65B9\u6848\u4E00\uFF1A\u4E00\u4E2A\u7EBF\u7A0B\u6267\u884C\u4EFB\u52A1A\u548CB\uFF0CA\u6267\u884C\u5B8C\u540E\uFF0C\u6267\u884CB</li><li>\u65B9\u6848\u4E8C\uFF1A\u4E24\u4E2A\u7EBF\u7A0BA\u548CB\u53BB\u6267\u884C\u4EFB\u52A1A \u548C B\uFF0C\u540C\u65F6\u8FDB\u884C</li></ul><p><strong>\u54EA\u4E2A\u65B9\u6848\u4F1A\u5FEB\u70B9\uFF1F</strong></p><p>\u5E94\u8BE5\u5F88\u591A\u4EBA\u4F1A\u56DE\u7B54\uFF0C<strong>\u80AF\u5B9A\u662F\u65B9\u6848\u4E8C\u554A</strong>\uFF0C\u591A\u7EBF\u7A0B\u5E76\u884C\u53BB\u5904\u7406\u4EFB\u52A1A\u548CB\uFF0C\u80AF\u5B9A\u5FEB\u554A\u3002</p><p>\u662F\u8FD9\u6837\u5417\uFF1F**\u56DE\u7B54\u8FD9\u4E2A\u95EE\u9898\u4E4B\u524D\uFF0C**\u5148\u5E26\u7740\u5927\u5BB6\u53BB\u56DE\u987E\u68B3\u7406\u4E00\u4E0B\u3002</p><p>Arithmetic</p><h2 id="\u4E09\u3001\u7EBF\u7A0B\u6267\u884C" tabindex="-1"><a class="header-anchor" href="#\u4E09\u3001\u7EBF\u7A0B\u6267\u884C" aria-hidden="true">#</a> \u4E09\u3001\u7EBF\u7A0B\u6267\u884C</h2><p>\u7EBF\u7A0B\u7684\u6267\u884C\uFF0C\u662F\u7531CPU\u8FDB\u884C\u8C03\u5EA6\u7684\uFF0C\u4E00\u4E2ACPU\u5728\u540C\u4E00\u65F6\u523B\u53EA\u4F1A\u6267\u884C\u4E00\u4E2A\u7EBF\u7A0B\uFF0C\u6211\u4EEC\u770B\u4E0A\u53BB\u7684\u7EBF\u7A0BA\u548C\u7EBF\u7A0BB\u5E76\u53D1\u6267\u884C\u3002</p><p>\u4E3A\u4E86\u8BA9\u7528\u6237\u611F\u89C9\u8FD9\u4E9B\u4EFB\u52A1\u6B63\u5728\u540C\u65F6\u8FDB\u884C\uFF0C\u64CD\u4F5C\u7CFB\u7EDF\u5229\u7528\u4E86\u65F6\u95F4\u7247\u8F6E\u8F6C\u7684\u65B9\u5F0F\uFF0CCPU\u7ED9\u6BCF\u4E2A\u4EFB\u52A1\u90FD\u670D\u52A1\u4E00\u5B9A\u7684\u65F6\u95F4\uFF0C\u7136\u540E\u628A\u5F53\u524D\u4EFB\u52A1\u7684\u72B6\u6001\u4FDD\u5B58\u4E0B\u6765\uFF0C\u5728\u52A0\u8F7D\u4E0B\u4E00\u4EFB\u52A1\u7684\u72B6\u6001\u540E\uFF0C\u7EE7\u7EED\u670D\u52A1\u4E0B\u4E00\u4EFB\u52A1\u3002\u4EFB\u52A1\u7684\u72B6\u6001\u4FDD\u5B58\u53CA\u518D\u52A0\u8F7D\uFF0C\u8FD9\u6BB5\u8FC7\u7A0B\u5C31\u53EB\u505A\u4E0A\u4E0B\u6587\u5207\u6362\u3002</p><p>\u4E0A\u4E0B\u6587\u5207\u6362\u8FC7\u7A0B\u662F\u9700\u8981\u65F6\u95F4\u7684\uFF0C\u73B0\u5728\u6211\u4EEC\u6765\u770B\u4E00\u4E0B\u4E0A\u9762\u7684\u95EE\u9898\uFF0C\u5C0F\u4F19\u4F34\u4EEC\u518D\u770B\u4E00\u4E0B\u662F\u54EA\u4E2A\u65B9\u6848\u5FEB\u5462\uFF1F</p><p>\u662F\u4E0D\u662F\u6709\u4E9B\u5C0F\u4F19\u4F34\u4EEC\u4F1A\u8BF4\u65B9\u6848\u4E00\uFF0C\u56E0\u4E3A\u4E0D\u9700\u8981\u7EBF\u7A0B\u5207\u6362\uFF1B\u65B9\u6848\u4E8C\u9700\u8981\u6765\u56DE\u5207\u6362\u8FD9\u4E24\u4E2A\u7EBF\u7A0B\uFF0C\u8017\u65F6\u4F1A\u591A\u70B9\u3002</p><p>\u5C0F\u4F19\u4F34\u4EEC\u5FC3\u4E2D\u6B64\u65F6\u662F\u4E0D\u662F\u4F1A\u6709\u7591\u60D1\uFF0C**\u90A3\u4E3A\u4EC0\u4E48\u4F1A\u6709\u591A\u7EBF\u7A0B\uFF1F**\u5148\u4E0D\u6025\uFF0C\u518D\u5F80\u4E0B\u770B\u3002</p><h2 id="\u56DB\u3001\u4E3A\u4EC0\u4E48\u8981\u591A\u7EBF\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u56DB\u3001\u4E3A\u4EC0\u4E48\u8981\u591A\u7EBF\u7A0B" aria-hidden="true">#</a> \u56DB\u3001\u4E3A\u4EC0\u4E48\u8981\u591A\u7EBF\u7A0B</h2><p>\u5C0F\u4F19\u4F34\u60F3\u60F3\u5728\u6211\u4EEC<strong>\u771F\u5B9E\u4E1A\u52A1\u4E2D\uFF0C\u6211\u4EEC\u662F\u4EC0\u4E48\u6D41\u7A0B\uFF1F</strong></p><p><img src="https://mmbiz.qpic.cn/mmbiz_jpg/UtWdDgynLdb0iauAicBo9uqdvwjMiaYWkpegKoXJfibJXniaTTuB2JuiaWYyqAHC0KRiaAVpK2UBRMZzrbvcXaYUHicEzA/640?wx_fmt=jpeg&amp;wxfrom=5&amp;wx_lazy=1&amp;wx_co=1" alt="\u56FE\u7247" loading="lazy"></p><p>\u4E0A\u56FE\u7684\u6D41\u7A0B\uFF1A</p><ol><li>\u5148\u53D1\u8D77\u7F51\u7EDC\u8BF7\u6C42</li><li>Web\u670D\u52A1\u5668\u89E3\u6790\u8BF7\u6C42</li><li>\u8BF7\u6C42\u540E\u7AEF\u7684\u6570\u636E\u5E93\u83B7\u53D6\u6570\u636E</li><li>\u83B7\u53D6\u6570\u636E\u540E\uFF0C\u8FDB\u884C\u5904\u7406</li><li>\u628A\u5904\u7406\u7ED3\u679C\u653E\u56DE\u7ED9\u7528\u6237</li></ol><p>\u8FD9\u4E2A\u662F\u6211\u4EEC\u5904\u7406\u4E1A\u52A1\u7684\u65F6\u5019\uFF0C<strong>\u5E38\u89C4\u7684\u8BF7\u6C42\u6D41\u7A0B</strong>\uFF1B\u6211\u4EEC\u770B\u4E00\u4E0B\u6574\u4E2A\u8FC7\u7A0B<strong>\u6D89\u53CA\u5230\u4EC0\u4E48\u8BA1\u7B97\u673A\u5904\u7406\u3002</strong></p><ol><li>\u7F51\u7EDC\u8BF7\u6C42-----&gt;\u7F51\u7EDCIO</li><li>\u89E3\u6790\u8BF7\u6C42-----&gt;CPU</li><li>\u8BF7\u6C42\u6570\u636E\u5E93-----&gt;\u7F51\u7EDCIO</li><li>MySQL\u67E5\u8BE2\u6570\u636E-----&gt;\u78C1\u76D8IO</li><li>MySQL\u8FD4\u56DE\u6570\u636E-----&gt;\u7F51\u7EDCIO</li><li>\u6570\u636E\u5904\u7406-----&gt;CPU</li><li>\u8FD4\u56DE\u6570\u636E\u7ED9\u7528\u6237-----&gt;\u7F51\u7EDCIO</li></ol><p>\u8BB2\u5230\u8FD9\u91CC\uFF0C\u5C0F\u4F19\u4F34\u4EEC\u662F\u4E0D\u662F\u611F\u89C9\u53C8\u4E0D\u4E71\u4E86\uFF0C\u5728<strong>\u771F\u5B9E\u4E1A\u52A1\u4E2D\u6211\u4EEC\u4E0D\u5355\u5355\u4F1A\u6D89\u53CACPU\u8BA1\u7B97\uFF0C\u8FD8\u6709\u7F51\u7EDCIO\u548C\u78C1\u76D8IO\u5904\u7406</strong>\uFF0C\u8FD9\u4E9B\u5904\u7406\u662F\u975E\u5E38\u8017\u65F6\u7684\u3002\u5982\u679C\u4E00\u4E2A\u7EBF\u7A0B\u6574\u4E2A\u6D41\u7A0B\u662F\u4E0A\u56FE\u7684\u6D41\u7A0B\uFF0C\u771F\u6B63\u6D89\u53CA\u5230CPU\u7684\u53EA\u67092\u4E2A\u8282\u70B9\uFF0C\u5176\u4ED6\u7684\u8282\u70B9\u90FD\u662FIO\u5904\u7406\uFF0C\u90A3\u4E48\u7EBF\u7A0B\u5728\u505AIO\u5904\u7406\u7684\u65F6\u5019\uFF0CCPU\u5C31\u7A7A\u95F2\u51FA\u6765\u4E86\uFF0CCPU\u7684\u5229\u7528\u7387\u5C31\u4E0D\u9AD8\u3002</p><p>\u5C0F\u4F19\u4F34\u4EEC\u73B0\u5728\u77E5\u9053<strong>\u591A\u7EBF\u7A0B\u7684\u7528\u5904\u4E86\u5427\uFF0C\u5BF9\uFF0C\u5C31\u662F\u4E3A\u4E86\u63D0\u5347CPU\u5229\u7528\u7387</strong>\u3002</p><h2 id="\u4E94\u3001\u63D0\u5347qps-tps" tabindex="-1"><a class="header-anchor" href="#\u4E94\u3001\u63D0\u5347qps-tps" aria-hidden="true">#</a> \u4E94\u3001\u63D0\u5347QPS/TPS</h2><p>\u8861\u91CF\u7CFB\u7EDF\u6027\u80FD\u5982\u4F55\uFF0C\u4E3B\u8981\u6307\u6807\u7CFB\u7EDF\u7684\uFF08QPS/TPS\uFF09</p><ol><li>QPS/TPS\uFF1A\u6BCF\u79D2\u80FD\u591F\u5904\u7406\u8BF7\u6C42/\u4E8B\u52A1\u7684\u6570\u91CF</li><li>\u5E76\u53D1\u6570\uFF1A\u7CFB\u7EDF\u540C\u65F6\u5904\u7406\u7684\u8BF7\u6C42/\u4E8B\u52A1\u7684\u6570\u91CF</li><li>\u54CD\u5E94\u65F6\u95F4\uFF1A\u5C31\u662F\u5E73\u5747\u5904\u7406\u4E00\u4E2A\u8BF7\u6C42/\u4E8B\u52A1\u9700\u8981\u65F6\u957F</li></ol><p><code>QPS/TPS = \u5E76\u53D1\u6570/\u54CD\u5E94\u65F6\u95F4</code></p><p>\u4E0A\u9762\u516C\u5F0F\u4EE3\u8868<strong>\u5E76\u53D1\u6570\u8D8A\u5927\uFF0CQPS\u5C31\u8D8A\u5927</strong>\uFF1B\u6240\u4EE5\u5F88\u591A\u4EBA\u5C31\u4F1A\u4EE5\u4E3A\u8C03\u5927\u7EBF\u7A0B\u6C60\uFF0C\u5E76\u53D1\u6570\u5C31\u4F1A\u5927\uFF0C\u4E5F\u4F1A\u63D0\u5347QPS\uFF0C\u6240\u4EE5\u624D\u4F1A\u51FA\u73B0\u4E00\u5F00\u59CB\u524D\u8A00\u6240\u8BF4\u7684\uFF0C\u5927\u591A\u6570\u4EBA\u7684\u8BEF\u533A\u3002</p><p><strong>\u5176\u5B9EQPS\u8FD8\u8DDF\u54CD\u5E94\u65F6\u95F4\u6210\u53CD\u6BD4\uFF0C\u54CD\u5E94\u65F6\u95F4\u8D8A\u5927\uFF0CQPS\u5C31\u4F1A\u8D8A\u5C0F\u3002</strong></p><p>\u867D\u7136\u5E76\u53D1\u6570\u8C03\u5927\u4E86\uFF0C\u5C31\u4F1A\u63D0\u5347QPS\uFF0C\u4F46<strong>\u7EBF\u7A0B\u6570\u4E5F\u4F1A\u5F71\u54CD\u54CD\u5E94\u65F6\u95F4</strong>\uFF0C\u56E0\u4E3A\u4E0A\u9762\u6211\u4EEC\u4E5F\u63D0\u5230\u4E86\u4E0A\u4E0B\u6587\u5207\u6362\u7684\u95EE\u9898\uFF0C\u90A3<strong>\u600E\u4E48\u8BBE\u7F6E\u7EBF\u7A0B\u6570\u7684\u5462\uFF1F</strong></p><h2 id="\u516D\u3001\u5982\u4F55\u8BBE\u7F6E\u7EBF\u7A0B\u6570" tabindex="-1"><a class="header-anchor" href="#\u516D\u3001\u5982\u4F55\u8BBE\u7F6E\u7EBF\u7A0B\u6570" aria-hidden="true">#</a> \u516D\u3001\u5982\u4F55\u8BBE\u7F6E\u7EBF\u7A0B\u6570</h2><p>\u90A3\u6211\u4EEC\u5982\u4F55\u5206\u914D\u7EBF\u7A0B\uFF1F\u6211\u4EEC\u63D0\u4F9B\u4E00\u4E2A\u516C\u5F0F\uFF1A</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>\u6700\u4F73\u7EBF\u7A0B\u6570\u76EE = \uFF08\uFF08\u7EBF\u7A0B\u7B49\u5F85\u65F6\u95F4+\u7EBF\u7A0BCPU\u65F6\u95F4\uFF09/\u7EBF\u7A0BCPU\u65F6\u95F4 \uFF09* CPU\u6570\u76EE
</code></pre><div class="line-numbers" aria-hidden="true"><span class="line-number">1</span><br></div></div><blockquote><p>\u5907\u6CE8\u8FD9\u4E2A\u516C\u5F0F\u4E5F\u662F<strong>\u524D\u8F88\u4EEC\u5206\u4EAB</strong>\u7684\uFF0C\u5F53\u7136\u4E4B\u524D\u770B\u4E86<strong>\u6DD8\u5B9D\u524D\u53F0\u7CFB\u7EDF\u4F18\u5316\u5B9E\u8DF5</strong>\u7684\u6587\u7AE0\uFF0C\u548C\u4E0A\u9762\u7684\u516C\u5F0F\u5F88\u7C7B\u4F3C\uFF0C\u4E0D\u8FC7\u5728CPU\u6570\u76EE\u90A3\u8FB9\uFF0C\u4ED6\u4EEC\u66F4\u7EC6\u5316\u4E86\uFF0C<strong>\u4E0A\u9762\u7684\u516C\u5F0F\u53EA\u662F\u53C2\u8003</strong>\u3002\u4E0D\u8FC7\u4E0D\u7BA1\u4EC0\u4E48\u516C\u5F0F\uFF0C<strong>\u6700\u7EC8\u8FD8\u662F\u5728\u751F\u4EA7\u73AF\u5883\u4E2D\u8FD0\u884C\u540E\uFF0C\u518D\u4F18\u5316\u8C03\u6574\u3002</strong></p></blockquote><p>\u6211\u4EEC\u7EE7\u7EED\u4E0A\u9762\u7684\u4EFB\u52A1\uFF0C\u6211\u4EEC\u7684<strong>\u670D\u52A1\u5668CPU\u6838\u6570\u4E3A4\u6838\uFF0C\u4E00\u4E2A\u4EFB\u52A1\u7EBF\u7A0Bcpu\u8017\u65F6\u4E3A20ms\uFF0C\u7EBF\u7A0B\u7B49\u5F85\uFF08\u7F51\u7EDCIO\u3001\u78C1\u76D8IO\uFF09\u8017\u65F680ms\uFF0C\u90A3\u6700\u4F73\u7EBF\u7A0B\u6570\u76EE\uFF1A( 80 + 20 )/20 * 4 = 20</strong>\u3002\u4E5F\u5C31\u662F\u8BBE\u7F6E20\u4E2A\u7EBF\u7A0B\u6570\u6700\u4F73\u3002</p><p>\u4ECE\u8FD9\u4E2A\u516C\u5F0F\u4E0A\u9762\u6211\u4EEC\u5C31\u5F97\u51FA\uFF0C<strong>\u7EBF\u7A0B\u7684\u7B49\u5F85\u65F6\u95F4\u8D8A\u5927\uFF0C\u7EBF\u7A0B\u6570\u5C31\u8981\u8BBE\u7F6E\u8D8A\u5927</strong>\uFF0C\u8FD9\u4E2A\u6B63\u597D\u7B26\u5408\u6211\u4EEC\u4E0A\u9762\u7684\u5206\u6790\uFF0C\u53EF\u63D0\u5347CPU\u5229\u7528\u7387\u3002\u90A3\u4ECE\u53E6\u4E00\u4E2A\u89D2\u5EA6\u4E0A\u9762\u8BF4\uFF0C<strong>\u7EBF\u7A0B\u6570\u8BBE\u7F6E\u591A\u5927\uFF0C\u662F\u6839\u636E\u6211\u4EEC\u81EA\u8EAB\u7684\u4E1A\u52A1\u7684\uFF0C\u9700\u8981\u81EA\u5DF1\u53BB\u538B\u529B\u6D4B\u8BD5\uFF0C\u8BBE\u7F6E\u4E00\u4E2A\u5408\u7406\u7684\u6570\u503C\u3002</strong></p><h2 id="\u4E03\u3001\u57FA\u7840\u5E38\u89C4\u6807\u51C6" tabindex="-1"><a class="header-anchor" href="#\u4E03\u3001\u57FA\u7840\u5E38\u89C4\u6807\u51C6" aria-hidden="true">#</a> \u4E03\u3001\u57FA\u7840\u5E38\u89C4\u6807\u51C6</h2><p>\u90A3\u6211\u4EEC\u5C0F\u4F19\u4F34\u4EEC\u4F1A\u95EE\uFF0C<strong>\u56E0\u4E3A\u5F88\u591A\u4E1A\u52A1\u96C6\u4E2D\u5230\u4E00\u4E2A\u7EBF\u7A0B\u6C60\u4E2D\uFF0C\u4E0D\u50CF\u4E0A\u9762\u7684\u6848\u4F8B\u6BD4\u8F83\u7B80\u5355\uFF0C\u4E8B\u5B9E\u4E0A\u4E1A\u52A1\u592A\u591A\uFF0C\u600E\u4E48\u8BBE\u7F6E\u5462</strong>\uFF1F\u8FD9\u4E2A\u5C31\u662F\u8981\u53BB\u538B\u529B\u6D4B\u8BD5\u53BB\u8C03\u6574\u3002\u4E0D\u8FC7\u6211\u4EEC\u7684\u524D\u8F88\u5DF2\u7ECF\u5E2E\u6211\u4EEC\u603B\u7ED3\u4E86\u4E00\u4E2A\u57FA\u7840\u7684\u503C\uFF08\u6700\u7EC8\u8FD8\u662F\u8981\u770B\u8FD0\u884C\u60C5\u51B5\u81EA\u884C\u8C03\u6574\uFF09</p><ol><li>CPU\u5BC6\u96C6\u578B\uFF1A**\u64CD\u4F5C\u5185\u5B58\u5904\u7406\u7684\u4E1A\u52A1\uFF0C\u4E00\u822C\u7EBF\u7A0B\u6570\u8BBE\u7F6E\u4E3A\uFF1ACPU\u6838\u6570 + 1 \u6216\u8005 CPU\u6838\u6570*2\u3002\u6838\u6570\u4E3A4\u7684\u8BDD\uFF0C\u4E00\u822C\u8BBE\u7F6E 5 \u6216 8</li><li>IO\u5BC6\u96C6\u578B\uFF1A**\u6587\u4EF6\u64CD\u4F5C\uFF0C\u7F51\u7EDC\u64CD\u4F5C\uFF0C\u6570\u636E\u5E93\u64CD\u4F5C\uFF0C\u4E00\u822C\u7EBF\u7A0B\u8BBE\u7F6E\u4E3A\uFF1Acpu\u6838\u6570 / (1-0.9)\uFF0C\u6838\u6570\u4E3A4\u7684\u8BDD\uFF0C\u4E00\u822C\u8BBE\u7F6E 40</li></ol><h2 id="\u516B\u3001\u603B\u7ED3" tabindex="-1"><a class="header-anchor" href="#\u516B\u3001\u603B\u7ED3" aria-hidden="true">#</a> \u516B\u3001\u603B\u7ED3</h2><p>\u4ECA\u5929\u4ECB\u7ECD\u4E86\u7EBF\u7A0B\u6570\u5927\u5C0F\u7684\u8BBE\u7F6E\uFF0C\u4E00\u4E9B\u5C0F\u4F19\u4F34\u4EEC\u7684\u8BEF\u533A\u3002\u8BB2\u5230\u8FD9\u91CC\u6211\u4EEC\u5C0F\u4F19\u4F34\u4EEC\u662F\u4E0D\u662F\u5BF9\u7EBF\u7A0B\u6709\u4E86\u66F4\u65B0\u7684\u7406\u89E3\uFF0C<strong>\u4E0D\u50CF\u4E4B\u524D\u90A3\u4E48\u7C97\u66B4\uFF0C\u5E94\u8BE5\u8981\u53BB\u5206\u6790\u4E3A\u4EC0\u4E48\u8FD9\u4E48\u6162\uFF0C\u7CFB\u7EDF\u7684\u74F6\u9888\u51FA\u73B0\u5728\u4EC0\u4E48\u5730\u65B9\uFF0C\u51CF\u5C11\u74F6\u9888\u7684\u8017\u65F6\u3002</strong></p><p>\u53E6\u5916\uFF0C\u63A8\u8350\u5C0F\u4F19\u4F34\u4EEC\u518D\u53BB\u770B\u4E00\u4E0BRedis\u3001Nginx\uFF1B\u4E3A\u4EC0\u4E48\u4ED6\u4EEC\u4F1A\u90A3\u4E48\u5FEB\u5462\uFF1F\u5176\u5B9E\u548C\u8FD9\u7BC7\u6587\u7AE0\u7684\u77E5\u8BC6\u70B9\u6709\u5171\u540C\u7684\u5730\u65B9\u3002</p>`,47);function e(n,o){return a}var l=t(i,[["render",e],["__file","thread-pool-nums-set.html.vue"]]);export{l as default};
